import logo from "../../images/Logo.svg";

function Header({ isRegisterPage }) {
  return (
    <header className="header">
      <ul className="header__links">
        <li>
          <a href="/main">
            <img
              src={logo}
              alt="Логотип"
              className="logo button-clickable"
              id="logo"
            />
          </a>
        </li>
        <li>
          <a
            href={isRegisterPage ? "/sign-in" : "/sign-up"}
            className="header__link button-clickable"
          >
            {isRegisterPage ? "Войти" : "Регистрация"}
          </a>
        </li>
      </ul>
    </header>
  );
}

export default Header;
